import React from "react";
import "../../App.css";
import LoggedInNav from "../elements/LoggedInNav";
import Cards from "../elements/Cards";
import Section from "../elements/Section";
import Footer from "../elements/Footer";

function LoggedIn() {
  return (
    <>
    <LoggedInNav />
      <Section />
      <Cards />
      <Footer />
    </>
  );
}

export default LoggedIn;
